import React from 'react'
import styles from './index.module.css'



interface MyBioProps {
    bioData: {
        city: string;
        birthday: Date;
        nameCollege: string;
        yearStop: string;
        courses: {
            nameSchool: string;
            profession: string | null;
            stack: string | null;
            start: Date;
            stop: Date;
        }[]
    }
}

const Biography = (props: MyBioProps) => {
  return (
    <div>
        <h2 className={styles.bio_title}>
            MY BIOGRAPHY
        </h2>
        <div>
            <h3>
                CITY
